import { Injectable, OnInit } from '@angular/core';
import { Book } from '../models/Book';

@Injectable({
  providedIn: 'root'
})
export class BooksService {

  constructor() { }

  getAllBooks(): Book[]{
    return [
      {name: "Book1", writer: "zika", pages: 123},
      {name: "Book2", writer: "pera", pages: 32}
    ]
  }

  findBooks(searchParam:string):Book[]{
    return this.getAllBooks().filter(b=>b.name.includes("Book"));
  }
}
